import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

function Intro() {

  const classes = useStyles();

  return (
    <Paper className={classes.paper}>Intro</Paper>
  )
}

function Profile() {

  const classes = useStyles();

  return (
    <Paper className={classes.paper}>Profile</Paper>
  )
}

function App() {
  const classes = useStyles();

  return (
    // <div className={classes.root}>
    //   <Grid container spacing={3} align="center" justify="center" direction="row">
    //     <Grid container spacing={3} align="center" justify="center" direction="column">
    //       <Grid item xs={6} alignItems="center">
    //         <Paper className={classes.paper}>Brenden Smith</Paper>
    //       </Grid>
    //     </Grid>
    //     <Grid container spacing={3} align="center" justify="center" direction="column"></Grid>
    //       <Grid item xs={6} justify="center">
    //         <Avatar alt="Brenden Smith" src=""/>
    //       </Grid>
    //     </Grid>
    // </div>
    <div container className={classes.root}>
      <Grid container spacing={3} align="center" justify="center">
        <Grid item xs={6}>
          <Intro/>
        </Grid>
        <Grid item xs={6}>
          <Profile/>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
